    double w1p = 0.5*(s + t + u), w2p = 0.5*(s - t - u), w1 = 0.5*(s - t + u), w2 = 0.5*(s + t - u);
    pairWeight pw_1a = findPw(-w2p - wpr), pw_1b = findPw(w1p + wpr), pw_2a = findPw(+w2 + wpr), pw_2b = findPw(w1 + wpr);

